import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import LoginPage from './pages/LoginPage';
import DashboardPage from './pages/DashboardPage';
import OperationalTimePage from './pages/OperationalTimePage';
import './App.css';

function App() {
  const token = localStorage.getItem('token');
  return (
    <Router>
      <div className="app-header">
        <div className="app-title">Machine Status</div>
        <nav className="app-nav">
          <Link to="/dashboard" className="app-link">Dashboard</Link>
          <Link to="/operational-time" className="app-link">Operational Time</Link>
        </nav>
      </div>
      <Routes>
        <Route path="/login" element={<LoginPage />} />
        <Route path="/dashboard" element={token ? <DashboardPage /> : <Navigate to="/login" />} />
        <Route path="/operational-time" element={<OperationalTimePage />} />
        <Route path="*" element={<Navigate to={token ? "/dashboard" : "/login"} />} />
      </Routes>
    </Router>
  );
}
export default App;
